INSERT INTO `DDMTemplate` VALUES ('5acc7de7-7375-f402-2479-065c45d591df',20418,20195,20155,20159,'','2020-06-11 12:10:17.000000','2020-06-11 12:24:34.798000',20007,0,'BLOGS-BASIC-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Basic</Name><Name language-id=\"ar_SA\"></Name><Name language-id=\"ca_ES\">Bsic</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"nl_NL\">Basis</Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"hu_HU\">Egyszer</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Bsico</Name><Name language-id=\"es_ES\">Bsico</Name><Name language-id=\"sv_SE\">Standard</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"ar_SA\">       .</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description><Description language-id=\"fi_FI\">Nytt blogien otsikot, tekijt ja lyhenteet lyhyesti</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manire compacte pour les entres de blog.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen fr Blogeintrge.</Description><Description language-id=\"hu_HU\">Megjelenti kompakt mdon a cmeket, szerzket s kivonatokat a blog bejegyzsekhez.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"pt_BR\">Exibe ttulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"es_ES\">Muestra de forma compacta ttulos, autores y resmenes para las entradas del blog.</Description><Description language-id=\"sv_SE\">Visa rubriker, frfattare och sammanfattningar kompakt fr blogginlgg.</Description></root>','display','','ftl','<div class=\"widget-mode-simple\">\n	<#if entries?has_content>\n		<#list entries as curBlogEntry>\n			<div class=\"widget-mode-simple-entry\">\n				<div class=\"autofit-row widget-topbar\">\n					<div class=\"autofit-col autofit-col-expand\">\n						<#assign viewEntryPortletURL = renderResponse.createRenderURL() />\n\n						${viewEntryPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n\n						<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n							${viewEntryPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n						<#else>\n							${viewEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n						</#if>\n\n						<h3 class=\"title\">\n							<a class=\"title-link\" href=\"${viewEntryPortletURL.toString()}\">${htmlUtil.escape(blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry))}</a>\n						</h3>\n					</div>\n\n					<div class=\"autofit-col visible-interaction\">\n						<div class=\"dropdown dropdown-action\">\n							<@liferay_ui[\"icon-menu\"]\n								direction=\"left-side\"\n								icon=\"\"\n								markupView=\"lexicon\"\n								message=\"actions\"\n								showWhenSingleIcon=true\n							>\n								<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, \"UPDATE\")>\n									<#assign editEntryPortletURL = renderResponse.createRenderURL() />\n\n									${editEntryPortletURL.setWindowState(windowStateFactory.getWindowState(\"MAXIMIZED\"))}\n									${editEntryPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/edit_entry\")}\n									${editEntryPortletURL.setParameter(\"redirect\", currentURL)}\n									${editEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n\n									<@liferay_ui[\"icon\"]\n										label=true\n										message=\"edit\"\n										url=editEntryPortletURL.toString()\n									/>\n								</#if>\n								<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, \"PERMISSIONS\")>\n									<#assign permissionsEntryURL = permissionsURLTag.doTag(null, \"com.liferay.blogs.model.BlogsEntry\", blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry), curBlogEntry.getGroupId()?string, curBlogEntry.getEntryId()?string, windowStateFactory.getWindowState(\"POP_UP\").toString(), null, request) />\n\n									<@liferay_ui[\"icon\"]\n										label=true\n										message=\"permissions\"\n										method=\"get\"\n										url=permissionsEntryURL\n										useDialog=true\n									/>\n								</#if>\n								<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, \"DELETE\")>\n									<#assign deleteEntryPortletURL = renderResponse.createActionURL() />\n\n									${deleteEntryPortletURL.setParameter(\"javax.portlet.action\", \"/blogs/edit_entry\")}\n									${deleteEntryPortletURL.setParameter(\"cmd\", trashHelper.isTrashEnabled(themeDisplay.getScopeGroupId())?then(\"move_to_trash\", \"delete\"))}\n									${deleteEntryPortletURL.setParameter(\"redirect\", currentURL)}\n									${deleteEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n\n									<@liferay_ui[\"icon-delete\"]\n										label=true\n										trash=trashHelper.isTrashEnabled(themeDisplay.getScopeGroupId())\n										url=deleteEntryPortletURL.toString()\n									/>\n								</#if>\n							</@>\n						</div>\n					</div>\n				</div>\n\n				<div class=\"autofit-row widget-metadata\">\n					<div class=\"autofit-col inline-item-before\">\n						<@liferay_ui[\"user-portrait\"]\n							userId=curBlogEntry.userId\n							userName=curBlogEntry.userName\n						/>\n					</div>\n\n					<div class=\"autofit-col autofit-col-expand\">\n						<div class=\"autofit-row\">\n							<div class=\"autofit-col autofit-col-expand\">\n								<#if serviceLocator??>\n									<#assign\n										userLocalService = serviceLocator.findService(\"com.liferay.portal.kernel.service.UserLocalService\")\n\n										entryUser = userLocalService.fetchUser(curBlogEntry.getUserId())\n									/>\n\n									<#if entryUser?? && !entryUser.isDefaultUser()>\n										<#assign entryUserURL = entryUser.getDisplayURL(themeDisplay) />\n									</#if>\n								</#if>\n\n								<div class=\"text-truncate-inline\">\n									<a href=\"${(entryUserURL?? && validator.isNotNull(entryUserURL))?then(entryUserURL, \"\")}\" class=\"text-truncate username\">${curBlogEntry.getUserName()}</a>\n								</div>\n\n								<div>\n									${dateUtil.getDate(curBlogEntry.getStatusDate(), \"dd MMM\", locale)}\n\n									<#if blogsPortletInstanceConfiguration.enableReadingTime()>\n										- <@liferay_reading_time[\"reading-time\"] displayStyle=\"simple\" model=curBlogEntry />\n									</#if>\n\n									<#if serviceLocator??>\n										<#assign\n											assetEntryLocalService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetEntryLocalService\")\n\n											assetEntry = assetEntryLocalService.getEntry(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())\n										/>\n\n										<#if blogsPortletInstanceConfiguration.enableViewCount()>\n											- <@liferay_ui[\"message\"] arguments=assetEntry.getViewCount() key=(assetEntry.getViewCount()==0)?then(\"x-view\", \"x-views\") />\n										</#if>\n									</#if>\n								</div>\n							</div>\n						</div>\n					</div>\n				</div>\n\n				<div class=\"widget-content\">\n					<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(curBlogEntry.getContent()), 400)}</p>\n\n					<div class=\"autofit-float autofit-row autofit-row-center widget-toolbar\">\n						<#if blogsPortletInstanceConfiguration.enableComments()>\n							<div class=\"autofit-col\">\n								<#assign viewCommentsPortletURL = renderResponse.createRenderURL() />\n\n								${viewCommentsPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n								${viewCommentsPortletURL.setParameter(\"scroll\", renderResponse.getNamespace() + \"discussionContainer\")}\n\n								<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n									${viewCommentsPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n								<#else>\n									${viewCommentsPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n								</#if>\n\n								<a class=\"btn btn-outline-borderless btn-outline-secondary btn-sm\" href=\"${viewCommentsPortletURL.toString()}\" title=\"${language.get(locale, \"comments\")}\">\n									<span class=\"inline-item inline-item-before\">\n										<@clay[\"icon\"] symbol=\"comments\" />\n									</span> ${commentManager.getCommentsCount(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())}\n								</a>\n							</div>\n						</#if>\n\n						<#if blogsPortletInstanceConfiguration.enableRatings()>\n							<div class=\"autofit-col\">\n								<@liferay_ui[\"ratings\"]\n									className=\"com.liferay.blogs.model.BlogsEntry\"\n									classPK=curBlogEntry.getEntryId()\n								/>\n							</div>\n						</#if>\n\n						<div class=\"autofit-col autofit-col-end\">\n							<#assign bookmarkURL = renderResponse.createRenderURL() />\n\n							${bookmarkURL.setWindowState(windowStateFactory.getWindowState(\"NORMAL\"))}\n							${bookmarkURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n\n							<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n								${bookmarkURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n							<#else>\n								${bookmarkURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n							</#if>\n\n							<@liferay_social_bookmarks[\"bookmarks\"]\n								className=\"com.liferay.blogs.model.BlogsEntry\"\n								classPK=curBlogEntry.getEntryId()\n								displayStyle=\"inline\"\n								target=\"_blank\"\n								title=blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry)\n								types=blogsPortletInstanceConfiguration.socialBookmarksTypes()\n								url=portalUtil.getCanonicalURL(bookmarkURL.toString(), themeDisplay, themeDisplay.getLayout())\n							/>\n						</div>\n					</div>\n				</div>\n			</div>\n		</#list>\n	</#if>\n</div>',0,0,20419,'',20159,'',26537,'1.1',NULL,1,0),('5eaebc20-e493-0d97-a113-ca592fb910de',20420,20195,20155,20159,'','2020-06-11 12:10:17.000000','2020-06-11 12:24:26.614000',20083,0,'ASSET-PUBLISHER-RICH-SUMMARY-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Rich Summary</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"ca_ES\">Resum enriquit</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"nl_NL\">Rijke samenvatting</Name><Name language-id=\"fi_FI\">Muotoiltu yhteenveto</Name><Name language-id=\"fr_FR\">Sommaire enrichi</Name><Name language-id=\"de_DE\">Rich-Text-Zusammenfassung</Name><Name language-id=\"hu_HU\">B sszest</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Sumrio Rico</Name><Name language-id=\"es_ES\">Resumen completo</Name><Name language-id=\"sv_SE\">Utfrlig sammanfattning</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays abstracts, icons, related assets, and print/edit actions for assets. Optionally include asset bookmarks and ratings.</Description><Description language-id=\"ar_SA\">       / .        .</Description><Description language-id=\"ca_ES\">Mostra resums, icones, continguts relacionats i accions d\'impressi o edici per continguts. Opcionalment, inclou enllaos i valoracions.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Toon samenvattingen, pictogrammen, gerelateerde content en afdruk en bewerk acties voor content. Voeg optioneel bladwijzers en beoordelingen toe.</Description><Description language-id=\"fi_FI\">Nytt lyhenteet, kuvakkeet, liittyvt sisllt ja sisltjen tulosta/muokkaa toiminnot. Voit ottaa mukaan mys sisltjen kirjanmerkit ja arvostelut.</Description><Description language-id=\"fr_FR\">Affiche les rsums, icons, les assets relatifs, et les actions imprimer/diter pour les assets. Facultativement inclut les signets et les notations d\'assets.</Description><Description language-id=\"de_DE\">Stellt Kurzfassungen, Icons, verwandte Assets sowie Druck- und Bearbeitungsoptionen fr Assets dar. Kann auch Bookmarks und Bewertungen enthalten.</Description><Description language-id=\"hu_HU\">Megjelenti a kivonatokat, ikonokat, a kapcsold tartalmakat, s a nyomtatsi/szerkesztsi mveleteket a tarlamakhoz. Opcionlisan tartalmazza a tartalom knyvjelzket s rtkelseket.</Description><Description language-id=\"ja_JP\">/</Description><Description language-id=\"pt_BR\">Exibe abstracts, cones, contedos relacionados e aes de imprimir/editar para os contedos. Opcionalmente, inclui marcadores e classificaes de contedos.</Description><Description language-id=\"es_ES\">Muestra abstractos, iconos, activos relacionados e imprime/edita acciones para activos. Opcionalmente incluye marcadores de activos y calificaciones.</Description><Description language-id=\"sv_SE\">Visar sammanfattningar, ikoner, liknande tillgngar samt utskrifts- och redigeringstgrder fr tillgngar. Valfritt inkluderar bokmrken och omdmen fr tillgngar.</Description></root>','display','','ftl','<#if !entries?has_content>\n	<#if !themeDisplay.isSignedIn()>\n		${renderRequest.setAttribute(\"PORTLET_CONFIGURATOR_VISIBILITY\", true)}\n	</#if>\n\n	<div class=\"alert alert-info\">\n		<@liferay_ui[\"message\"] key=\"there-are-no-results\" />\n	</div>\n</#if>\n\n<#list entries as entry>\n	<#assign\n		entry = entry\n\n		assetRenderer = entry.getAssetRenderer()\n\n		entryTitle = htmlUtil.escape(assetRenderer.getTitle(locale))\n\n		viewURL = assetPublisherHelper.getAssetViewURL(renderRequest, renderResponse, assetRenderer, entry, !stringUtil.equals(assetLinkBehavior, \"showFullContent\"))\n	/>\n\n	<div class=\"asset-abstract\">\n		<div class=\"float-right\">\n			<@getPrintIcon />\n\n			<@getFlagsIcon />\n\n			<@getEditIcon />\n		</div>\n\n		<h3 class=\"asset-title\">\n			<a href=\"${viewURL}\">\n				${entryTitle}\n			</a>\n		</h3>\n\n		<@getMetadataField fieldName=\"tags\" />\n\n		<@getMetadataField fieldName=\"create-date\" />\n\n		<@getMetadataField fieldName=\"view-count\" />\n\n		<div class=\"asset-content\">\n			<@getSocialBookmarks />\n\n			<div class=\"asset-summary\">\n				<@getMetadataField fieldName=\"author\" />\n\n				${htmlUtil.escape(assetRenderer.getSummary(renderRequest, renderResponse))}\n\n				<a href=\"${viewURL}\"><@liferay.language key=\"read-more\" /><span class=\"hide-accessible\"><@liferay.language key=\"about\" />${entryTitle}</span> &raquo;</a>\n			</div>\n\n			<@getRatings />\n\n			<@getRelatedAssets />\n\n			<@getDiscussion />\n		</div>\n	</div>\n</#list>\n\n<#macro getDiscussion>\n	<#if getterUtil.getBoolean(enableComments) && assetRenderer.isCommentable()>\n		<br />\n\n		<#assign discussionURL = renderResponse.createActionURL() />\n\n		${discussionURL.setParameter(\"javax.portlet.action\", \"invokeTaglibDiscussion\")}\n\n		<@liferay_comment[\"discussion\"]\n			className=entry.getClassName()\n			classPK=entry.getClassPK()\n			formAction=discussionURL?string\n			formName=\"fm\" + entry.getClassPK()\n			ratingsEnabled=getterUtil.getBoolean(enableCommentRatings)\n			redirect=currentURL\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign editPortletURL = assetRenderer.getURLEdit(renderRequest, renderResponse, windowStateFactory.getWindowState(\"NORMAL\"), themeDisplay.getURLCurrent())!\"\" />\n\n		<#if validator.isNotNull(editPortletURL)>\n			<#assign title = languageUtil.format(locale, \"edit-x\", entryTitle, false) />\n\n			<@liferay_ui[\"icon\"]\n				cssClass=\"icon-monospaced visible-interaction\"\n				icon=\"pencil\"\n				markupView=\"lexicon\"\n				message=title\n				url=editPortletURL.toString()\n			/>\n		</#if>\n	</#if>\n</#macro>\n\n<#macro getFlagsIcon>\n	<#if getterUtil.getBoolean(enableFlags)>\n		<@liferay_flags[\"flags\"]\n			className=entry.getClassName()\n			classPK=entry.getClassPK()\n			contentTitle=entry.getTitle(locale)\n			label=false\n			reportedUserId=entry.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getMetadataField\n	fieldName\n>\n	<#if stringUtil.split(metadataFields)?seq_contains(fieldName)>\n		<span class=\"metadata-entry metadata-${fieldName}\">\n			<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n			<#if stringUtil.equals(fieldName, \"author\")>\n				<@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(assetRenderer.getUserId(), assetRenderer.getUserName()))}\n			<#elseif stringUtil.equals(fieldName, \"categories\")>\n				<@liferay_asset[\"asset-categories-summary\"]\n					className=entry.getClassName()\n					classPK=entry.getClassPK()\n					portletURL=renderResponse.createRenderURL()\n				/>\n			<#elseif stringUtil.equals(fieldName, \"create-date\")>\n				${dateUtil.getDate(entry.getCreateDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"expiration-date\")>\n				${dateUtil.getDate(entry.getExpirationDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"modified-date\")>\n				${dateUtil.getDate(entry.getModifiedDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"priority\")>\n				${entry.getPriority()}\n			<#elseif stringUtil.equals(fieldName, \"publish-date\")>\n				${dateUtil.getDate(entry.getPublishDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"tags\")>\n				<@liferay_asset[\"asset-tags-summary\"]\n					className=entry.getClassName()\n					classPK=entry.getClassPK()\n					portletURL=renderResponse.createRenderURL()\n				/>\n			<#elseif stringUtil.equals(fieldName, \"view-count\")>\n				${entry.getViewCount()} <@liferay.language key=\"views\" />\n			</#if>\n		</span>\n	</#if>\n</#macro>\n\n<#macro getPrintIcon>\n	<#if getterUtil.getBoolean(enablePrint)>\n		<#assign printURL = renderResponse.createRenderURL() />\n\n		${printURL.setParameter(\"mvcPath\", \"/view_content.jsp\")}\n		${printURL.setParameter(\"assetEntryId\", entry.getEntryId()?string)}\n		${printURL.setParameter(\"viewMode\", \"print\")}\n		${printURL.setParameter(\"type\", entry.getAssetRendererFactory().getType())}\n		${printURL.setWindowState(\"pop_up\")}\n\n		<@liferay_ui[\"icon\"]\n			icon=\"print\"\n			markupView=\"lexicon\"\n			message=\"print\"\n			url=\"javascript:Liferay.Util.openWindow({id:\'\" + renderResponse.getNamespace() + \"printAsset\', title: \'\" + languageUtil.format(locale, \"print-x-x\", [\"hide-accessible\", entryTitle], false) + \"\', uri: \'\" + htmlUtil.escapeURL(printURL.toString()) + \"\'});\"\n		/>\n	</#if>\n</#macro>\n\n<#macro getRatings>\n	<#if getterUtil.getBoolean(enableRatings) && assetRenderer.isRatable()>\n		<div class=\"asset-ratings\">\n			<@liferay_ui[\"ratings\"]\n				className=entry.getClassName()\n				classPK=entry.getClassPK()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if getterUtil.getBoolean(enableRelatedAssets)>\n		<@liferay_asset[\"asset-links\"]\n			assetEntryId=entry.getEntryId()\n			viewInContext=!stringUtil.equals(assetLinkBehavior, \"showFullContent\")\n		/>\n	</#if>\n</#macro>\n\n<#macro getSocialBookmarks>\n	<@liferay_social_bookmarks[\"bookmarks\"]\n		className=entry.getClassName()\n		classPK=entry.getClassPK()\n		displayStyle=\"${socialBookmarksDisplayStyle}\"\n		target=\"_blank\"\n		title=entry.getTitle(locale)\n		types=\"${socialBookmarksTypes}\"\n		url=viewURL\n	/>\n</#macro>',0,0,20421,'',20159,'',26537,'1.1',NULL,1,0),('3c329c29-3663-53dd-d321-9b9724e3bb27',20422,20195,20155,20159,'','2020-06-11 12:10:17.000000','2020-06-11 12:24:14.319000',20034,0,'SITE-MAP-MULTI-COLUMN-LAYOUT-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"sv_SE\">Layout med flera kolumner</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description><Description language-id=\"ar_SA\">     .            .</Description><Description language-id=\"ca_ES\">Mostra una columna per cada pgina de nivell superior. A cada columna, s\'hi inclou el nom d\'una pgina de nivell superior amb el fill immediat de la pgina en una llista a la part inferior.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Geeft een kolom weer voor elke pagina op het hoogste niveau. Elke kolom bevat de naam van een bovenliggende pagina met alle directe onderliggende pagina\'s eronder.</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaiselle yltason sivulle. Jokainen sarake sislt yltason sivun nimen ja sivun vlittmt alasivut lueteltuna alapuolella.</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page de niveau suprieur. Chaque colonne comprend le nom d\'une page de niveau suprieur avec les enfants immdiats indiqus en-dessous.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte fr jede Seite der obersten Ebene. Jede Spalte enthlt den Namen einer Seite der obersten Ebene, darunter werden die direkten Unterseiten aufgelistet.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden fels szint oldalhoz. Mindegyik oszlop tartalmazza a legfels szint oldal nevt, alatta az oldal kzvetlen utdjval.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada pgina de nvel superior. Cada coluna inclui o nome de uma pgina de nvel superior com os filhos imediatos da pgina listados abaixo.</Description><Description language-id=\"es_ES\">Muestra una columna por cada pgina de nivel superior. En cada columna, se incluye el nombre de una pgina de nivel superior con el elemento secundario inmediato de la pgina en una lista de la parte inferior.</Description><Description language-id=\"sv_SE\">Visar en kolumn fr varje sida p den hgsta nivn. Varje kolumn inkluderar namnet p varje sida p den hgsta nivn samt sidans omedelbara underordnade element listade under den.</Description></root>','display','','ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<#if layoutPermission.containsWithoutViewableGroup(permissionChecker, entry, \"VIEW\")>\n				<@liferay_aui.col width=25>\n					<div class=\"results-header\">\n						<h3>\n							<a\n\n							<#assign layoutType = entry.getLayoutType() />\n\n							<#if layoutType.isBrowsable()>\n								href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n							</#if>\n\n							>${entry.getName(locale)}</a>\n						</h3>\n					</div>\n\n					<@displayPages\n						depth=1\n						pages=entry.getChildren(permissionChecker)\n					/>\n				</@liferay_aui.col>\n			</#if>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	depth\n	pages\n>\n	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<li>\n					<a\n\n					<#assign pageType = page.getLayoutType() />\n\n					<#if pageType.isBrowsable()>\n						href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n					</#if>\n\n					>${page.getName(locale)}</a>\n\n					<@displayPages\n						depth=depth + 1\n						pages=page.getChildren(permissionChecker)\n					/>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,20423,'',20159,'',26537,'1.1',NULL,1,0),('e5f2bf79-d713-33b6-ed61-734f13de306e',20425,20195,20155,20159,'','2020-06-11 12:10:17.000000','2020-06-11 12:24:14.649000',20424,0,'DOCUMENTLIBRARY-CAROUSEL-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Carousel</Name><Name language-id=\"ar_SA\"></Name><Name language-id=\"ca_ES\">Carrussel</Name><Name language-id=\"zh_CN\">Carousel</Name><Name language-id=\"nl_NL\">Carrousel</Name><Name language-id=\"fi_FI\">Karuselli</Name><Name language-id=\"fr_FR\">Carrousel</Name><Name language-id=\"de_DE\">Karussel</Name><Name language-id=\"hu_HU\">Krhinta</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Carrossel</Name><Name language-id=\"es_ES\">Carrusel</Name><Name language-id=\"sv_SE\">Carousel</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays images in a carousel.</Description><Description language-id=\"ar_SA\">   .</Description><Description language-id=\"ca_ES\">Mostra imatges en format carrusel.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Geeft afbeeldingen weer in een carrousel.</Description><Description language-id=\"fi_FI\">Nytt kuvat karusellissa.</Description><Description language-id=\"fr_FR\">Affiche les images dans un carrousel.</Description><Description language-id=\"de_DE\">Darstellung von Bildern in einem Karussell.</Description><Description language-id=\"hu_HU\">Megjelenti a kpeket krhintaszeren.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"pt_BR\">Exibe imagens num carrossel.</Description><Description language-id=\"es_ES\">Muestra imgenes en un carrusel.</Description><Description language-id=\"sv_SE\">Visar bilder i carousel-format.</Description></root>','display','','ftl','<#if entries?has_content>\n	<style>\n		#<@portlet.namespace />carousel .carousel-item {\n			background-color: #000;\n			height: 250px;\n			overflow: hidden;\n			text-align: center;\n			width: 700px;\n		}\n\n		#<@portlet.namespace />carousel .carousel-item img {\n			max-height: 250px;\n			max-width: 700px;\n		}\n	</style>\n\n	<div id=\"<@portlet.namespace />carousel\">\n		<#assign imageMimeTypes = propsUtil.getArray(\"dl.file.entry.preview.image.mime.types\") />\n\n		<#list entries as entry>\n			<#if imageMimeTypes?seq_contains(entry.getMimeType())>\n				<div class=\"carousel-item image-viewer-base-image\">\n					<img src=\"${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, \"\")}\" />\n				</div>\n			</#if>\n		</#list>\n	</div>\n\n	<@liferay_aui.script use=\"aui-carousel\">\n		var carousel = new A.Carousel(\n			{\n				after: {\n					responsive: function(event) {\n						event.stopImmediatePropagation();\n\n						var boundingBox = event.currentTarget.get(\'boundingBox\');\n\n						boundingBox.all(\'.image-viewer-base-image-list, .image-viewer-base-image\').setStyles(\n							{\n								height: \'auto\',\n								maxHeight: event.height,\n								maxWidth: event.width,\n								width: \'auto\'\n							}\n						);\n					}\n				},\n\n				contentBox: \'#<@portlet.namespace />carousel\',\n				height: 250,\n				intervalTime: 2,\n				width: 700\n			}\n		).render();\n	</@liferay_aui.script>\n</#if>',0,0,20426,'',20159,'',26537,'1.1',NULL,1,0),('5b18dee3-87e2-edbd-56e7-96d4dc38d770',20427,20195,20155,20159,'','2020-06-11 12:10:17.000000','2020-06-11 12:24:13.920000',20016,0,'WIKI-SOCIAL-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Social</Name><Name language-id=\"ar_SA\"></Name><Name language-id=\"ca_ES\">Social</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"nl_NL\">Sociaal</Name><Name language-id=\"fi_FI\">Sosiaalinen</Name><Name language-id=\"fr_FR\">Social</Name><Name language-id=\"de_DE\">Social</Name><Name language-id=\"hu_HU\">Kzssgi</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Social</Name><Name language-id=\"es_ES\">Social</Name><Name language-id=\"sv_SE\">Sociala ntverk</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays social bookmarks and ratings for wiki pages and their child pages.</Description><Description language-id=\"ar_SA\">        .</Description><Description language-id=\"ca_ES\">Mostra adreces d\'inters socials i classificacions per a planes del wiki.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Geeft sociale favorieten en waarderingen van wikipagina\'s en onderliggende wikipagina\'s weer.</Description><Description language-id=\"fi_FI\">Nytt sosiaaliset kirjanmerkit ja arvostelut wikisivuilla ja niiden alisivuilla.</Description><Description language-id=\"fr_FR\">Affiche les signets sociaux and les notations pour page wiki et leur pages enfants.</Description><Description language-id=\"de_DE\">Darstellung fr Social Bookmarks und Bewertungen von Wikiseiten und deren Unterseiten.</Description><Description language-id=\"hu_HU\">Megjelenti a kzssgi knyvjelzket s rtkelseket a wiki oldalak s gyermek oldalaik rszre.</Description><Description language-id=\"ja_JP\">Wiki</Description><Description language-id=\"pt_BR\">Exibe marcadores sociais e avaliaes para pginas da wiki e suas pginas filhas.</Description><Description language-id=\"es_ES\">Muestra los marcadores sociales y las clasificaciones para pginas wiki y sus pginas secundarias.</Description><Description language-id=\"sv_SE\">Visar sociala bokmrken och omdmen fr wiki-sidor och deras underordnade sidor.</Description></root>','display','','ftl','<#assign\n	wikiPageClassName = \"com.liferay.wiki.model.WikiPage\"\n\n	assetRenderer = assetEntry.getAssetRenderer()\n/>\n\n<div class=\"taglib-header\">\n	<h1 class=\"header-title\">${entry.getTitle()}</h1>\n</div>\n\n<div style=\"float: right;\">\n	<@getEditIcon />\n\n	<@getPageDetailsIcon />\n\n	<@getPrintIcon />\n</div>\n\n<div class=\"wiki-body\">\n	<div class=\"wiki-info\">\n		<span class=\"stats\">${assetEntry.getViewCount()} <@liferay.language key=\"views\" /></span> |\n\n		<span class=\"date\"><@liferay.language key=\"last-modified\" /> ${dateUtil.getDate(entry.getModifiedDate(), \"dd MMM yyyy - HH:mm:ss\", locale)}</span>\n\n		<span class=\"author\"><@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(entry.getUserId(), entry.getUserName()))}</span>\n	</div>\n\n	<div class=\"wiki-content\">\n		<@liferay_social_bookmarks[\"bookmarks\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			displayStyle=\"normal\"\n			target=\"_blank\"\n			title=entry.getTitle()\n			url=viewURL\n		/>\n\n		${formattedContent}\n	</div>\n\n	<div class=\"page-actions\">\n		<div class=\"article-actions\">\n			<@getAddChildPageIcon />\n\n			<@getAttatchmentsIcon />\n		</div>\n	</div>\n\n	 <br />\n\n	<@getRatings\n		cssClass=\"page-ratings\"\n		entry=entry\n	/>\n\n	<@getRelatedAssets />\n</div>\n\n<div class=\"page-categorization\">\n	<div class=\"page-categories\">\n		<#assign viewCategorizedPagesURL = renderResponse.createRenderURL() />\n\n		${viewCategorizedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_categorized_pages\")}\n		${viewCategorizedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_ui[\"asset-categories-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewCategorizedPagesURL\n		/>\n	</div>\n\n	<div class=\"page-tags\">\n		<#assign viewTaggedPagesURL = renderResponse.createRenderURL() />\n\n		${viewTaggedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_tagged_pages\")}\n		${viewTaggedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_ui[\"asset-tags-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewTaggedPagesURL\n		/>\n	</div>\n</div>\n\n<#assign childPages = entry.getChildPages() />\n\n<#if (childPages?has_content)>\n	<div class=\"child-pages\">\n		<h2><@liferay.language key=\"children-pages\" /></h2>\n\n		<table class=\"taglib-search-iterator\">\n			<tr class=\"portlet-section-header results-header\">\n				<th>\n					<@liferay.language key=\"page\" />\n				</th>\n				<th>\n					<@liferay.language key=\"last-modified\" />\n				</th>\n				<th>\n					<@liferay.language key=\"ratings\" />\n				</th>\n			</tr>\n\n			<#list childPages as childPage>\n				<tr class=\"results-row\">\n					<#assign viewPageURL = renderResponse.createRenderURL() />\n\n					${viewPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view\")}\n\n					<#assign childNode = childPage.getNode() />\n\n					${viewPageURL.setParameter(\"nodeName\", childNode.getName())}\n					${viewPageURL.setParameter(\"title\", childPage.getTitle())}\n\n					<td>\n						<a href=\"${viewPageURL}\">${childPage.getTitle()}</a>\n					</td>\n					<td>\n						<a href=\"${viewPageURL}\">${dateUtil.getDate(childPage.getModifiedDate(),\"dd MMM yyyy - HH:mm:ss\", locale)} <@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(childPage.getUserId(), childPage.getUserName()))}</a>\n					</td>\n					<td>\n						<@getRatings\n							cssClass=\"child-ratings\"\n							entry=childPage\n						/>\n					</td>\n				</tr>\n			</#list>\n		</table>\n	</div>\n</#if>\n\n<@getDiscussion />\n\n<#macro getAddChildPageIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign addPageURL = renderResponse.createRenderURL() />\n\n		${addPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${addPageURL.setParameter(\"redirect\", currentURL)}\n		${addPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${addPageURL.setParameter(\"title\", \"\")}\n		${addPageURL.setParameter(\"editTitle\", \"1\")}\n		${addPageURL.setParameter(\"parentTitle\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			icon=\"plus\"\n			label=true\n			markupView=\"lexicon\"\n			message=\"add-child-page\"\n			url=addPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getAttatchmentsIcon>\n	<#assign viewPageAttachmentsURL = renderResponse.createRenderURL() />\n\n	${viewPageAttachmentsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_attachments\") }\n\n	<@liferay_ui[\"icon\"]\n		icon=\"paperclip\"\n		label=true\n		markupView=\"lexicon\"\n		message=\'${entry.getAttachmentsFileEntriesCount() + languageUtil.get(locale, \"attachments\")}\'\n		url=viewPageAttachmentsURL?string\n	/>\n</#macro>\n\n<#macro getDiscussion>\n	<#if validator.isNotNull(assetRenderer.getDiscussionPath()) && wikiPortletInstanceConfiguration.enableComments()>\n		<br />\n\n		<@liferay_comment[\"discussion\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			ratingsEnabled=wikiPortletInstanceConfiguration.enableCommentRatings()\n			redirect=currentURL\n			subject=assetRenderer.getTitle(locale)\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign editPageURL = renderResponse.createRenderURL() />\n\n		${editPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${editPageURL.setParameter(\"redirect\", currentURL)}\n		${editPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${editPageURL.setParameter(\"title\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			icon=\"pencil\"\n			markupView=\"lexicon\"\n			message=entry.getTitle()\n			url=editPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getPageDetailsIcon>\n	<#assign viewPageDetailsURL = renderResponse.createRenderURL() />\n\n	${viewPageDetailsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_details\")}\n	${viewPageDetailsURL.setParameter(\"redirect\", currentURL)}\n\n	<@liferay_ui[\"icon\"]\n		icon=\"document\"\n		markupView=\"lexicon\"\n		message=\"details\"\n		url=viewPageDetailsURL?string\n	/>\n</#macro>\n\n<#macro getPrintIcon>\n	<#assign printURL = renderResponse.createRenderURL() />\n\n	${printURL.setParameter(\"viewMode\", \"print\")}\n	${printURL.setWindowState(\"pop_up\")}\n\n	<#assign\n		title = languageUtil.format(locale, \"print-x-x\", [\"hide-accessible\", htmlUtil.escape(assetRenderer.getTitle(locale))], false)\n		taglibPrintURL = \"javascript:Liferay.Util.openWindow({dialog: {width: 960}, id:\'\" + renderResponse.getNamespace() + \"printAsset\', title: \'\" + title + \"\', uri: \'\" + htmlUtil.escapeURL(printURL.toString()) + \"\'});\"\n	/>\n\n	<@liferay_ui[\"icon\"]\n		icon=\"print\"\n		markupView=\"lexicon\"\n		message=\"print\"\n		url=taglibPrintURL\n	/>\n</#macro>\n\n<#macro getRatings\n	cssClass\n	entry\n>\n	<#if wikiPortletInstanceConfiguration.enablePageRatings()>\n		<div class=\"${cssClass}\">\n			<@liferay_ui[\"ratings\"]\n				className=wikiPageClassName\n				classPK=entry.getResourcePrimKey()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if assetEntry?? && wikiPortletInstanceConfiguration.enableRelatedAssets()>\n		<@liferay_asset[\"asset-links\"] assetEntryId=assetEntry.getEntryId() />\n	</#if>\n</#macro>',0,0,20428,'',20159,'',26537,'1.1',NULL,1,0),('f094fcbc-d5ca-0f6f-a758-17186018d1c0',20429,20195,20155,20159,'','2020-06-11 12:10:17.000000','2020-06-11 12:24:14.276000',20085,0,'ASSET-TAGS-NAVIGATION-COLOR-BY-POPULARITY-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Color by Popularity</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"ca_ES\">Color per popularitat</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"nl_NL\">Kleur op populariteit</Name><Name language-id=\"fi_FI\">Vri suosion mukaan</Name><Name language-id=\"fr_FR\">Couleur par popularit</Name><Name language-id=\"de_DE\">Nach Popularitt frben</Name><Name language-id=\"hu_HU\">Szn npszersg alapjn</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Colorir por Popularidade</Name><Name language-id=\"es_ES\">Color por popularidad</Name><Name language-id=\"sv_SE\">Frga efter popularitet</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description><Description language-id=\"ar_SA\">     :  ()  ()  ().</Description><Description language-id=\"ca_ES\">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id=\"zh_CN\">  (),  (),  ().</Description><Description language-id=\"nl_NL\">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description><Description language-id=\"fi_FI\">Nytt sislttageja, mitk on vritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virhe (alhainen)</Description><Description language-id=\"fr_FR\">Affiche les tiquettes d\'asset colories par popularit: rouge (lev), jaune (moyen), et vert (bas).</Description><Description language-id=\"de_DE\">Schlagwrter nach Popularitt frben: Rot (hoch), gelb (mittel), grn (niedrig).</Description><Description language-id=\"hu_HU\">Megjelenti a tartalom cmkket npszersg szerint sznezve: vrs (magas), srga (kzepes), s zld (alacsony).</Description><Description language-id=\"ja_JP\">:())</Description><Description language-id=\"pt_BR\">Exibe marcadores coloridos por popularidade: vermelho (alta), amarelo (mdia) e verde (baixa).</Description><Description language-id=\"es_ES\">Muestra las etiquetas de contenido coloreadas segn su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id=\"sv_SE\">Visar tillgngstaggar frgade efter popularitet: rd (hg), gul (medelhg) och grn (lg).</Description></root>','display','','ftl','<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#assign\n				maxCount = liferay.max(maxCount, entry.getAssetCount())\n				minCount = liferay.min(minCount, entry.getAssetCount())\n			/>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<li class=\"taglib-asset-tags-summary\">\n				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />\n\n				<#if popularity < 1>\n					<#assign color = \"green\" />\n				<#elseif (popularity >= 1) && (popularity < 2)>\n					<#assign color = \"orange\" />\n				<#else>\n					<#assign color = \"red\" />\n				</#if>\n\n				<#assign tagURL = renderResponse.createRenderURL() />\n\n				${tagURL.setParameter(\"resetCur\", \"true\")}\n				${tagURL.setParameter(\"tag\", entry.getName())}\n\n				<a class=\"tag\" href=\"${tagURL}\" style=\"color: ${color};\">\n					${entry.getName()}\n\n					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>\n						<span class=\"tag-asset-count\">(${entry.getAssetCount()})</span>\n					</#if>\n				</a>\n			</li>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>',0,0,20430,'',20159,'',26537,'1.1',NULL,1,0),('922fa188-2c77-53ff-a2b5-13f56b1fba47',20431,20195,20155,20159,'','2020-06-11 12:10:17.000000','2020-06-11 12:24:14.230000',20081,0,'ASSET-CATEGORIES-NAVIGATION-MULTI-COLUMN-LAYOUT-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas