guage-id=\"en_US\">Navigation</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Navegacin</Name><Name language-id=\"nl_NL\">Navigatie</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar RSS-fldet som ett navigeringsflt i panelen till vnster. Om du klickar p fldet visas en lista med feedposter i panelen till hger.</Description><Description language-id=\"pt_BR\">Exibe os feeds RSS como uma barra de navegao no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id=\"ja_JP\">RSS</Description><Description language-id=\"fr_FR\">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d\'entres de flux sur le panneau droit.</Description><Description language-id=\"hu_HU\">Megjelenti az RSS hrcsatornkat navigcis oszlopknt a bal oldalon. Egy hrcsatornra kattintva megjelenti a hrcsatorna bejegyzsek listjt a jobb oldalon.</Description><Description language-id=\"de_DE\">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeintrge im rechten Bereich dargestellt.</Description><Description language-id=\"ca_ES\">Mostra els canals RSS com una barra de navegaci en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d\'entrades en el tauler dret.</Description><Description language-id=\"ar_SA\">  RSS     .             .</Description><Description language-id=\"fi_FI\">Nytt RSS-sytteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla sytett nytetn sytteen arvot oikeassa paneelissa.</Description><Description language-id=\"en_US\">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description><Description language-id=\"zh_CN\">RSSFeed</Description><Description language-id=\"es_ES\">Muestra las fuentes RSS como una barra de navegacin del panel izquierdo. Al hacer clic en una fuente se muestra una lista de entradas de la fuente en el panel derecho.</Description><Description language-id=\"nl_NL\">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description></root>','display',NULL,'ftl','<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-xs-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-xs-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div class=\"tab-pane\" id=\"tab-${curEntry_index}\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index > entriesPerFeed?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												icon=\"calendar\"\n												label=true\n												markupView=\"lexicon\"\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>',0,0,30230,NULL,20159,NULL,26537,'1.0',NULL,0,0),('dc3dd144-6375-bd18-3f3e-7c70117c561b',30232,20195,20155,20159,NULL,'2020-06-11 12:24:13.969000','2020-06-11 12:24:13.969000',20720,0,'LIST-MENU-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Listmeny</Name><Name language-id=\"pt_BR\">Menu de lista</Name><Name language-id=\"ja_JP\"> </Name><Name language-id=\"fr_FR\">Menu de Liste</Name><Name language-id=\"hu_HU\">Lista men</Name><Name language-id=\"de_DE\">Listenmen</Name><Name language-id=\"ca_ES\">Men de llista</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Luettelovalikko</Name><Name language-id=\"en_US\">List Menu</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Men de lista</Name><Name language-id=\"nl_NL\">Lijstmenu</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en navigeringsmeny med en lista.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegao com uma lista