d()}_${navItem.getLayoutId()}\" role=\"presentation\">\n						<a aria-labelledby=\"layout_${portletDisplay.getId()}_${navItem.getLayoutId()}\" ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span class=\"text-truncate\"><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,0,30257,NULL,20159,NULL,26537,'1.0',NULL,0,0),('315ab6f0-fc57-e53c-9f6c-3e5c97e43c28',30259,20195,20155,20159,NULL,'2020-06-11 12:24:14.111000','2020-06-11 12:24:14.111000',20720,0,'NAVIGATION-MACRO-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering i vanliga makron</Name><Name language-id=\"pt_BR\">Macros de navegao comuns</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Macros de navigation ordinaires</Name><Name language-id=\"hu_HU\">Navigci kzs makri</Name><Name language-id=\"de_DE\">Navigation hufige Makros</Name><Name language-id=\"ca_ES\">Macros comunes de navegaci</Name><Name language-id=\"ar_SA\">   </Name><Name language-id=\"fi_FI\">Navigoinnin yleiset makrot</Name><Name language-id=\"en_US\">Navigation common macros</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Macros comunes de navegacin</Name><Name language-id=\"nl_NL\">Algemene navigatiemacro\'s</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Innehller vanliga makron fr navigeringsmenymallar.</Description><Description language-id=\"pt_BR\">Contm macros comuns para o modelo do menu de navegao.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Contient les macros ordinaires pour les modles de menu de navigation.</Description><Description language-id=\"hu_HU\">A navigcis men sablonok kzs makrit tartalmazza.</Description><Description language-id=\"de_DE\">Enthlt hufige Makros fr Navigationsmenvorlagen.</Description><Description language-id=\"ca_ES\">Cont macros comunes per a les plantilles del men de navegaci.</Description><Description language-id=\"ar_SA\">       .</Description><Description language-id=\"fi_FI\">Sislt yleiset navigointivalikkomallien makrot.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Contiene macros comunes para plantillas del men de navegacin.</Description><Description language-id=\"nl_NL\">Bevat algemene macro\'s voor navigatiemenusjablonen.</Description></root>','macro',NULL,'ftl','<#macro buildChildrenNavItems\n	displayDepth\n	navItem\n	navItemLevel = 2\n>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n	/>\n\n	<#list navItem.getBrowsableChildren() as childNavigationItem>\n		<#assign\n			nav_child_css_class = \"\"\n		/>\n\n		<#if childNavigationItem.isSelected()>\n			<#assign\n				nav_child_css_class = \"active selected\"\n			/>\n		</#if>\n\n		<li class=\"${nav_child_css_class}\" id=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" role=\"presentation\">\n			<a aria-labelledby=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" class=\"dropdown-item\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n		</li>\n\n		<#if childNavigationItem.hasBrowsableChildren() && ((displayDepth == 0) || (navItemLevel < displayDepth))>\n			<ul class=\"list-unstyled pl-3\">\n				<@buildChildrenNavItems\n					displayDepth=displayDepth\n					navItem=childNavigationItem\n					navItemLevel=(navItemLevel + 1)\n				/>\n			</ul>\n		</#if>\n	</#list>\n</#macro>\n\n<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if navItem.isSelected()>\n					<#assign\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\">\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,30260,NULL,20159,NULL,26537,'1.0',NULL,0,0),('02b3b912-9e93-b22b-f378-0f72bf4b501e',30262,20195,20155,20159,NULL,'2020-06-11 12:24:14.124000','2020-06-11 12:24:14.124000',20720,0,'SPLIT-BUTTON-DROPDOWNS-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Nedrullningsbara listor med delningsknappar</Name><Name language-id=\"pt_BR\">Dividir menus suspensos de boto</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Partager les boutons du menu droulant</Name><Name language-id=\"hu_HU\">Osztott gomb legrdl elemei</Name><Name language-id=\"de_DE\">Dropdown mit geteilten Schaltflchen</Name><Name language-id=\"ca_ES\">Desplegables de bot de divisi</Name><Name language-id=\"ar_SA\">   </Name><Name language-id=\"fi_FI\">Jakopainikkeen Pudotusvalikot</Name><Name language-id=\"en_US\">Split Button Dropdowns</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Desplegables de botn de expansin</Name><Name language-id=\"nl_NL\">Rolmenu met uitgesplitste knoppen</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en nedrullningsbar navigeringsmeny med rotmenyobjekt som visas som knappar.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegao suspenso com itens do menu raiz mostrados como botes.</Description><Description language-id=\"ja_JP\"> </Description><Description language-id=\"fr_FR\">Affiche un menu de navigation droulant dont les lments sont affichs sous la forme de boutons.</Description><Description language-id=\"hu_HU\">Megjelent egy lenyl navigcis ment, amelyben a gykrszint menpontok gombokknt jelennek meg.</Description><Description language-id=\"de_DE\">Zeigt ein Dropdown-Navigationsmen mit Root-Menelementen als Schaltflchen an.</Description><Description language-id=\"ca_ES\">Mostra un men de navegaci desplegable els elements de men arrel que es mostren com a botons.</Description><Description language-id=\"ar_SA\">          .</Description><Description language-id=\"fi_FI\">Nytt pudotusnavigointivalikon juurivalikon kohdat esitettyn painikkeina.</Description><Description language-id=\"en_US\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra un men de navegacin desplegable con elementos de men raz que se muestran como botones.</Description><Description language-id=\"nl_NL\">Geeft een rolmenu voor navigatie weer met rootmenu-items in de vorm van knoppen.</Description></root>','display',NULL,'ftl','<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul class=\"navbar-site split-button-dropdowns\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildrenNavItems>\n					<#assign\n						nav_item_caret = \"\"\n						nav_item_css_class = \"\"\n						nav_item_href_link = \"\"\n					/>\n\n					<#if navItem.isSelected()>\n						<#assign nav_item_css_class = \"active\" />\n					</#if>\n\n					<#if showChildrenNavItems>\n						<#assign toggle_text>\n							<@liferay.language key=\"toggle\" />\n						</#assign>\n\n						<#assign nav_item_caret = \"<button aria-expanded=\'false\' aria-haspopup=\'true\' class=\'${nav_item_css_class} btn btn-secondary dropdown-toggle\' data-toggle=\'liferay-dropdown\' type=\'button\'><span class=\'caret\'></span><span class=\'sr-only\'>${toggle_text}</span></button>\" />\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\' ${navItem.getTarget()}\" />\n					</#if>\n\n					<li>\n						<a aria-labelledby=\"layout_${portletDisplay.getId()}_${navItem.getLayoutId()}\" class=\"${nav_item_css_class} btn btn-secondary\" ${nav_item_href_link}><span>${navItem.getName()}</span></a>${nav_item_caret}\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,0,30263,NULL,20159,NULL,26537,'1.0',NULL,0,0),('02ee75a7-2d65-49a1-acf1-858cebecc221',30266,20195,20155,20159,NULL,'2020-06-11 12:24:14.139000','2020-06-11 12:24:14.139000',26615,0,'SITE-FACET-COMPACT-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout Compacto</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezs</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposici compacta</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi