language-id=\"sv_SE\">Innehller vanliga makron fr navigeringsmenymallar.</Description><Description language-id=\"pt_BR\">Contm macros comuns para o modelo do menu de navegao.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Contient les macros ordinaires pour les modles de menu de navigation.</Description><Description language-id=\"hu_HU\">A navigcis men sablonok kzs makrit tartalmazza.</Description><Description language-id=\"de_DE\">Enthlt hufige Makros fr Navigationsmenvorlagen.</Description><Description language-id=\"ca_ES\">Cont macros comunes per a les plantilles del men de navegaci.</Description><Description language-id=\"ar_SA\">       .</Description><Description language-id=\"fi_FI\">Sislt yleiset navigointivalikkomallien makrot.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Contiene macros comunes para plantillas del men de navegacin.</Description><Description language-id=\"nl_NL\">Bevat algemene macro\'s voor navigatiemenusjablonen.</Description></root>','ftl','<#macro buildChildrenNavItems\n	displayDepth\n	navItem\n	navItemLevel = 2\n>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n	/>\n\n	<#list navItem.getBrowsableChildren() as childNavigationItem>\n		<#assign\n			nav_child_css_class = \"\"\n		/>\n\n		<#if childNavigationItem.isSelected()>\n			<#assign\n				nav_child_css_class = \"active selected\"\n			/>\n		</#if>\n\n		<li class=\"${nav_child_css_class}\" id=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" role=\"presentation\">\n			<a aria-labelledby=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" class=\"dropdown-item\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n		</li>\n\n		<#if childNavigationItem.hasBrowsableChildren() && ((displayDepth == 0) || (navItemLevel < displayDepth))>\n			<ul class=\"list-unstyled pl-3\">\n				<@buildChildrenNavItems\n					displayDepth=displayDepth\n					navItem=childNavigationItem\n					navItemLevel=(navItemLevel + 1)\n				/>\n			</ul>\n		</#if>\n	</#list>\n</#macro>\n\n<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if navItem.isSelected()>\n					<#assign\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\">\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20159,NULL,'2020-06-11 12:24:14.111000',0,0),(30264,20195,20155,20159,NULL,'2020-06-11 12:24:14.124000',20720,0,30262,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Nedrullningsbara listor 