vocabulaire avec les catgories du niveau racine listes en dessous.</Description><Description language-id=\"de_DE\">Stellt eine Spalte fr jedes Vokabular dar. Jede Spalte enthlt den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden sztr szmra. Minden oszlop tartalmazza a sztr nevt, alatta a sztr fels szint kategriival.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulrio. Cada coluna inclui o nome do vocabulrio com as categorias de nvel mais alto listadas abaixo dele.</Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categoras de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"sv_SE\">Visar en kolumn fr varje ordlista. Varje kolumn inkluderar namnet p en ordlista med ordlistans toppnivkategorier listade under.</Description></root>','ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n					</h3>\n				</div>\n\n				<#assign categories = entry.getCategories() />\n\n				<@displayCategories categories=categories />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20159,NULL,'2020-06-11 12:10:17.000000',0,0),(30273,20195,20155,20159,NULL,'2020-06-11 12:10:17.000000',20085,0,20429,'1.1','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Color by Popularity</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"ca_ES\">Color per popularitat</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"nl_NL\">Kleur op populariteit</Name><Name language-id=\"fi_FI\">Vri suosion mukaan</Name><Name language-id=\"fr_FR\">Couleur par popularit</Name><Name language-id=\"de_DE\">Nach Popularitt frben</Name><Name language-id=\"hu_HU\">Szn npszersg alapjn</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Colorir por Popularidade</Name><Name language-id=\"es_ES\">Color por popularidad</Name><Name language-id=\"sv_SE\">Frga efter popularitet</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description><Description language-id=\"ar_SA\">     :  ()  ()  ().</Description><Description language-id=\"ca_ES\">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id=\"zh_CN\">  (),  (),  ().</Description><Description language-id=\"nl_NL\">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description><Description language-id=\"fi_FI\">Nytt sislttageja, mitk on vritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virhe (alhainen)</Description><Description language-id=\"fr_FR\">Affiche les tiquettes d\'asset colories par popularit: rouge (lev), jaune (moyen), et vert (bas).</Description><Description language-id=\"de_DE\">Schlagwrter nach Popularitt frben: Rot (hoch), gelb (mittel), grn (niedrig).</Description><Description language-id=\"hu_HU\">Megjelenti a tartalom cmkket npszersg szerint sznezve: vrs (magas), srga (kzepes), s zld (alacsony).</Description><Description language-id=\"ja_JP\">:())</Description><Description language-id=\"pt_BR\">Exibe marcadores coloridos por popularidade: vermelho (alta), amarelo (mdia) e verde (baixa).</Description><Description language-id=\"es_ES\">Muestra las etiquetas de contenido coloreadas segn su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id=\"sv_SE\">Visar tillgngstaggar frgade efter popularitet: rd (hg), gul (medelhg) och grn (lg).</Description></root>','ftl','<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#assign\n				maxCount = liferay.max(maxCount, entry.getAssetCount())\n				minCount = liferay.min(minCount, entry.getAssetCount())\n			/>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<li class=\"taglib-asset-tags-summary\">\n				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />\n\n				<#if popularity < 1>\n					<#assign color = \"green\" />\n				<#elseif (popularity >= 1) && (popularity < 2)>\n					<#assign color = \"orange\" />\n				<#else>\n					<#assign color = \"red\" />\n				</#if>\n\n				<#assign tagURL = renderResponse.createRenderURL() />\n\n				${tagURL.setParameter(\"resetCur\", \"true\")}\n				${tagURL.setParameter(\"tag\", entry.getName())}\n\n				<a class=\"tag\" href=\"${tagURL}\" style=\"color: ${color};\">\n					${entry.getName()}\n\n					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>\n						<span class=\"tag-asset-count\">(${entry.getAssetCount()})</span>\n					</#if>\n				</a>\n			</li>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>',0,20159,NULL,'2020-06-11 12:10:17.000000',0,0),(30275,20195,20155,20159,NULL,'2020-06-11 12:10:17.000000',20034,0,20422,'1.1','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"sv_SE\">Layout med flera kolumner</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE,\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description><Description language-id=\"ar_SA\">     .            .</Description><Description language-id=\"ca_ES\">Mostra una columna per cada pgina de nivell superior. A cada columna, s\'hi inclou el nom d\'una pgina de nivell superior amb el fill immediat de la pgina en una llista a la part inferior.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Geeft een kolom weer voor elke pagina op het hoogste niveau. Elke kolom bevat de naam van een bovenliggende pagina met alle directe onderliggende pagina\'s eronder.</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaiselle yltason sivulle. Jokainen sarake sislt yltason sivun nimen ja sivun vlittmt alasivut lueteltuna alapuolella.</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page de niveau suprieur. Chaque colonne comprend le nom d\'une page de niveau suprieur avec les enfants immdiats indiqus en-dessous.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte fr jede Seite der obersten Ebene. Jede Spalte enthlt den Namen einer Seite der obersten Ebene, darunter werden die direkten Unterseiten aufgelistet.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden fels szint oldalhoz. Mindegyik oszlop tartalmazza a legfels szint oldal nevt, alatta az oldal kzvetlen utdjval.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada pgina de nvel superior. Cada coluna inclui o nome de uma pgina de nvel superior com os filhos imediatos da pgina listados abaixo.</Description><Description language-id=\"es_ES\">Muestra una columna por cada pgina de nivel superior. En cada columna, se incluye el nombre de una pgina de nivel superior con el elemento secundario inmediato de la pgina en una lista de la parte inferior.</Description><Description language-id=\"sv_SE\">Visar en kolumn fr varje sida p den hgsta nivn. Varje kolumn inkluderar namnet p varje sida p den hgsta nivn samt sidans omedelbara underordnade element listade under den.</Description></root>','ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<#if layoutPermission.containsWithoutViewableGroup(permissionChecker, entry, \"VIEW\")>\n				<@liferay_aui.col width=25>\n					<div class=\"results-header\">\n						<h3>\n							<a\n\n							<#assign layoutType = entry.getLayoutType() />\n\n							<#if layoutType.isBrowsable()>\n								href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n							</#if>\n\n							>${entry.getName(locale)}</a>\n						</h3>\n					</div>\n\n					<@displayPages\n						depth=1\n						pages=entry.getChildren(permissionChecker)\n					/>\n				</@liferay_aui.col>\n			</#if>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	depth\n	pages\n>\n	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<li>\n					<a\n\n					<#assign pageType = page.getLayoutType() />\n\n					<#if pageType.isBrowsable()>\n						href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n					</#if>\n\n					>${page.getName(locale)}</a>\n\n					<@displayPages\n						depth=depth + 1\n						pages=page.getChildren(permissionChecker)\n					/>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20159,NULL,'2020-06-11 12:10:17.000000',0,0),(30278,20195,20155,20159,NULL,'2020-06-11 12:24:14.334000',26616,0,30276,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Cloud-layout</Name><Name language-id=\"pt_BR\">Layout de nuvem</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Disposition du cloud</Name><Name language-id=\"hu_HU\">Felh elrendezs</Name><Name language-id=\"de_DE\">Cloudlayout</Name><Name language-id=\"ca_ES\">Disposici del nvol</Name><Name language-id=\"ar_SA\"> </Name><Name lang