t-text {\n		padding: 0 0.5em;\n	}\n</style>\n\n<#if entries?has_content>\n	<#list entries as entry>\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"a\"]\n				cssClass=\"language-entry-short-text\"\n				href=entry.getURL()\n				label=entry.getShortDisplayName()\n				lang=entry.getW3cLanguageId()\n			/>\n		</#if>\n	</#list>\n</#if>',0,20159,NULL,'2020-06-11 12:24:14.805000',0,0),(30348,20195,20155,20159,NULL,'2020-06-11 12:24:14.820000',26626,0,30346,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Radio-layout</Name><Name language-id=\"pt_BR\">Layout de rdio</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Disposition radio</Name><Name language-id=\"hu_HU\">Rdi elrendezs</Name><Name language-id=\"de_DE\">Optionsfelderlayout</Name><Name language-id=\"ca_ES\">Disposici de rdio</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Valintapainikeasettelu</Name><Name language-id=\"en_US\">Radio Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo de radio</Name><Name language-id=\"nl_NL\">Keuzerondjeslay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">portlet-display-template-description-radio</Description><Description language-id=\"pt_BR\">portlet-display-template-description-radio</Description><Description language-id=\"ja_JP\">portlet-display-template-description-radio</Description><Description language-id=\"fr_FR\">portlet-display-template-description-radio</Description><Description language-id=\"hu_HU\">portlet-display-template-description-radio</Description><Description language-id=\"de_DE\">portlet-display-template-description-radio</Description><Description language-