06-11 12:23:57.318000','2020-06-11 12:23:57.318000',20004,30105,'Asset Library Administrator',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,ca_ES,hu_HU,de_DE,ar_SA,fi_FI,es_ES,zh_CN,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Administratrer av tillgngsbibliotek r superanvndare av sitt tillgngsbibliotek, men kan inte gra andra anvndare till administratrer i tillgngsbiblioteket.</Description><Description language-id=\"pt_BR\">Os Administradores da Biblioteca de Ativos so super usurios da biblioteca de ativos, mas no podem tornar outros usurios Administradores da Biblioteca de Ativos.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Les administrateurs d\'un dpt sont des super utilisateurs de leur dpt, mais ne peuvent rendre administrateurs d\'autres utilisateurs.</Description><Description language-id=\"ca_ES\">Els administradors de la biblioteca de continguts sn superusuaris de la seva biblioteca de continguts, per no poden assignar el rol d\'administrador de biblioteca de continguts a altres usuaris.</Description><Description language-id=\"hu_HU\">Az adattr adminisztrtorai adattruk magasabbrend felhasznli, de nem nevezhetnek ki ms felhasznlkat az adattr adminisztrtoraiv.</Description><Description language-id=\"de_DE\">Repository-Administratoren sind Administratoren ihres Repositorys, knnen aber andere Benutzer nicht zu Repository-Administratoren machen.</Description><Description language-id=\"ar_SA\">                  .</Description><Description language-id=\"fi_FI\">Sisltkirjaston Pkyttjt ovat sisltkirjastonsa superkyttji, mutta eivt voi tehd muista kyttjist Sisltkirjaston Pkyttji.</Description><Description language-id=\"en_US\">Asset Library Administrators are super users of their asset library but cannot make other users into Asset Library Administrators.</Description><Description language-id=\"es_ES\">Los administradores del repositorio son superusuarios de su repositorio, pero no pueden convertir a otros usuarios en administradores del repositorio.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Assetbibliotheekbeheerders zijn supergebruikers van hun assetbibliotheek, maar kunnen geen assetbibliotheekbeheerders maken van andere gebruikers.</Description></root>',5,NULL,0,0),('658681a7-5e43-a109-9005-d1a728dba5d1',30106,20155,20159,NULL,'2020-06-11 12:23:57.342000','2020-06-11 12:23:57.342000',20004,30106,'Asset Library Connected Site Member',NULL,NULL,5,NULL,0,0),('cc7b9bba-2d2d-cc7a-2b2b-bf3d35453c47',30107,20155,20159,NULL,'2020-06-11 12:23:57.361000','2020-06-11 12:23:57.361000',20004,30107,'Asset Library Content Reviewer',NULL,NULL,5,NULL,0,0),('f193b15a-b0b9-0cd0-c695-f34c41360885',30108,20155,20159,NULL,'2020-06-11 12:23:57.378000','2020-06-11 12:23:57.378000',20004,30108,'Asset Library Member',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,ca_ES,hu_HU,de_DE,ar_SA,fi_FI,es_ES,zh_CN,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Alla anvndare som tillhr ett tillgngsbibliotek har den hr rollen i det tillgngsbiblioteket.</Description><Description language-id=\"pt_BR\">Todos os usurios que pertencem a uma biblioteca de ativos possuem esta funo nessa biblioteca de ativos.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Tous les utilisateurs qui appartiennent  un dpt ont ce rle au sein de ce dpt.</Description><Description language-id=\"ca_ES\">Tots els usuaris que pertanyin a una biblioteca de continguts tenen aquest rol en aquesta biblioteca de continguts.</Description><Description language-id=\"hu_HU\">Egy adattrhoz tartoz sszes felhasznl ezzel a szerepkrrel rendelkezik az adattron bell.</Description><Description language-id=\"de_DE\">Alle Benutzer, die zu einem Repository gehren, haben diese Rolle innerhalb dieses Repositorys inne.</Description><Description language-id=\"ar_SA\">              .</Description><Description language-id=\"fi_FI\">Kaikilla kyttjill, jotka kuuluvat sisltkirjastoon, on tm rooli kyseisen sisltkirjaston sisll.</Description><Description language-id=\"en_US\">All users who belong to an asset library have this role within that asset library.</Description><Description language-id=\"es_ES\">Todos los usuarios que pertenecen a un repositorio tienen este rol en ese repositorio.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Alle gebruikers die bij een assetbibliotheek horen, hebben deze rol in die assetbibliotheek.</Description></root>',5,NULL,0,0),('de027268-5990-f94b-9f84-777d597dfcac',30109,20155,20159,NULL,'2020-06-11 12:23:57.392000','2020-06-11 12:23:57.392000',20004,30109,'Asset Library Owner',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,ca_ES,hu_HU,de_DE,ar_SA,fi_FI,es_ES,zh_CN,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Administratrer av tillgngsbibliotek r superanvndare av sitt tillgngsbibliotek och kan tilldela roller i tillgngsbiblioteket till anvndare.</Description><Description language-id=\"pt_BR\">Os Proprietrios de Bibliotecas de Ativo so super usurios de suas bibliotecas de ativo e podem atribuir funes da biblioteca de ativos a outros usurios.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Les propritaires d\'un dpt sont des super utilisateurs de ce dpt et peuvent affecter des rles  des utilisateurs.</Description><Description language-id=\"ca_ES\">Els propietaris de la biblioteca de continguts sn superusuaris de la seva biblioteca de continguts, i poden assignar rols de la biblioteca de continguts als usuaris.</Description><Description language-id=\"hu_HU\">Az adattr tulajdonosai adattruk magasabbrend felhasznli, s adattr szerepkrket rendelhetnek hozz ms felhasznlkhoz.</Description><Description language-id=\"de_DE\">Besitzer von Repositorys sind Administratoren ihres Repositorys und knnen Benutzern Repository-Bibliotheksrollen zuweisen.</Description><Description language-id=\"ar_SA\">                .</Description><Description language-id=\"fi_FI\">Sisltkirjaston Omistajat ovat sisltkirjastonsa superkyttji, ja voivat liitt sisltkirjaston rooleja kyttjille.</Description><Description language-id=\"en_US\">Asset Library Owners are super users of their asset library and can assign asset library roles to users.</Description><Description language-id=\"es_ES\">Los propietarios de repositorio son superusuarios de su repositorio y pueden asignar roles de repositorio a otros usuarios.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"nl_NL\">Assetbibliotheekeigenaars zijn supergebruikers van hun assetbibliotheek en kunnen assetbibliotheekrollen toewijzen aan gebruikers.</Description></root>',5,NULL,0,0),('ad6237f1-5634-9c8e-0b40-b9ebae9533f3',30187,20155,20159,NULL,'2020-06-11 12:24:12.371000','2020-06-11 12:24:12.371000',26405,30186,'Account Member',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">All users who belong to an account have this role within that account.</Description></root>',6,NULL,0,0),('3b4e6b25-7cf0-8e66-9fc0-f9336b280d56',30189,20155,20159,NULL,'2020-06-11 12:24:12.408000','2020-06-11 12:24:12.408000',26405,30188,'Account Administrator',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Account Administrators are super users of their account.</Description></root>',6,NULL,0,0),('97dcd4ad-dcee-0418-589e-67fcbe5abc29',30192,20155,20159,NULL,'2020-06-11 12:24:12.477000','2020-06-11 12:24:12.477000',20004,30192,'Account Manager',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Account Managers who belong to an organization can administer all accounts associated to that organization.</Description></root>',3,NULL,0,0);
